SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO


CREATE procedure [dbo].[CreateOutputData] 
as
set nocount on 
set ansi_warnings off


truncate table SONISOutput



INSERT INTO [dbo].[SONISOutput]
           ([Action]
           ,[Campus]
           ,[Department]
           ,[Division]
           ,[Course]
           ,[Session]
           ,[Section]
           ,[SchoolYear]
           ,[Semester]
           ,[UserName]
           ,[SONISID]
           ,[LastName]
           ,[FirstName]
		   )
   select distinct
           'ENROLL'
           ,case 
		   when cm.Program='Pharmacy' then 'COP'
		   when cm.Program='Medicine' then 'COM'
		   else 'Unknown'
		   end
           ,'TB'  --<Department, varchar(50),>
           ,case 
		   when cm.Program='Pharmacy' then 'CP'
		   when cm.Program='Medicine' then 'CM'
		   else 'Unknown'
		   end   ---<Division, varchar(50),>
           ,CourseNumber --<Course, varchar(50),>
           ,Session  --Session  --<Session, varchar(50),>
           ,'1'  --<Section, varchar(50),>
           ,(select school_year + convert(varchar,(convert(int,right(school_year,2))+1))
		   from semesters sm where cm.DateEntered between sm.start_date and sm.end_date)   --<SchoolYear, varchar(50),>
           ,(select semester
		      from semesters sm where cm.DateEntered between sm.start_date and sm.end_date)   --<Semester, varchar(50),>
           ,left(email,charindex('@',email)-1) --<UserName, varchar(50),>
           ,JenzabarID --<SONISID, varchar(50),>
           ,LastName --<LastName, varchar(50),>
           ,FirstName  --<FirstName, varchar(50),>)
		   
		   from 
		   CORE_ELMSImport cm
		   where isnull(coursenumber,'')<>''

		  

set nocount off
set ansi_warnings on 
GO
