create procedure [dbo].[FillSemesterTable]
as
set nocount on
set ansi_warnings off



INSERT INTO [dbo].[Semesters]
           (TermCalendarID,
		   [school_year]
           ,[semester]
           ,[semester_description]
           ,[start_date]
           ,[end_date])


SELECT Termcalendarid,
      right(textterm,4) as 'schoolyear'
	  ,case 
	  when patindex('%Fall%',textterm) > 0 then '1'
	  when patindex('Spring%',textterm) <> 0 then '2'
	  when patindex('Summer%',textterm) <> 0 then '3'
	  else '0'
	  end      
      ,[TextTerm]
      ,[TermStartDate]
      ,[TermEndDate]
   FROM [CORE_ELMS].[dbo].[TermCalendar]


 
